(5, 'Notas del parche 14.9: cambios a la hitbox de campeones entre varios buffs y nerfs', '25/04/24', 'Puede sonar a tópico, pero el próximo parche 14.9 de League of Legends quizá cambie muchas cosas en el juego, pues Riot Games se va a adentrar en un aspecto del MOBA que ha generado infinidad de cabreos en sus jugadores. Las hitboxes son una parte esencial de LoL y cualquier videojuego online, pues son básicamente la forma de golpear a un campeón con una habilidad o ataque, y esta versión 14.9 modificará varios hitboxes.', );
INSERT INTO `tablog` (`id`, `titulo`, `fecha`, `des`, `img`) VALUES
(6, 'Diablo 4 retrasa el estreno de su Temporada 4 para trabajar en una gran avalancha de novedades que afectarán a su jugabilidad', '25/04/24', 'Desde que Diablo IV comenzó su andadura se ha criticado demasiado el que el juego se vuelve demasiado repetitivo o que sus temporadas no añaden las suficientes novedades como para que se vuelva más interesante jugar. Blizzard es plenamente consciente de la situación, de ahí que haya decidido ponerle remedio con una gran cantidad de novedades que implementará en su RPG de acción con la llegada de la futura Temporada 4.', );
INSERT INTO `tablog` (`id`, `titulo`, `fecha`, `des`, `img`) VALUES
